$(document).ready(function(){var c=$("#Inputfield__pw_page_name");if(!c.length||c.val().length){return}var a=$(".InputfieldPageTitle input[type=text]");$(".InputfieldPageName .LanguageSupport input[type=text]").each(function(){if($(this).val().length>0){$(this).addClass("InputfieldPageNameNoUpdate")}});if($("#ProcessPageAdd").length>0){var b=function(){var d=$(this).val();var e=$(this).attr("id").replace(/Inputfield_title_*/,"Inputfield__pw_page_name");c=$("#"+e);if(c.hasClass("InputfieldPageNameNoUpdate")){return}if(c.length){c.val(d).trigger("blur")}};a.bind("keyup change",b);$(".InputfieldPageName input").change(function(){if($(this).val()!=$(this).attr("data-prev")){$(this).addClass("InputfieldPageNameNoUpdate")}}).each(function(){$(this).attr("data-prev",$(this).val())})}});